import {useState,useEffect} from 'react';
import styled from 'styled-components';
import Form from '../UserForm/Form'
import Test from '../UserForm/test'
import Delete from '../Buttons/Delete';
import Edit from '../Buttons/Edit';
import Copy from '../Buttons/Copy';
import {connect} from 'react-redux';
import { useDispatch , useSelector } from 'react-redux'
import { additemInitiate, getitemsInitiate, deleteitemInitiate, edititemInitiate,updateitemInitiate,deleteitemAllInitiate, copyitemInitiate } from '../../../Actions/action';


const TableBody = ({search}) =>{

    const {data,website,searchdata} = useSelector(state=>state.data)

    // const searcheddata = data.filter((i)=> {
    //     return Object.values(i).join(" ").toLowerCase().includes(search.toLowerCase())
    // })
    const [editMode,seteditMode] = useState(false)
    const [websiteid, setwebsiteid] = useState(null)
    const [radio, setradio] = useState([])

    const dispatch = useDispatch()
    const initialstate = {
    code:'',
    domain: '',
    cpanel : '',
    username: '',
    password : '',
    owner: ''}
    const [input,setinput] = useState(initialstate)

    const onchangehandler = (event) =>{
        setinput({...input,[event.target.id]:event.target.value})
    }
    const submitHandler = (e) =>{   
        e.preventDefault()
        if(!editMode){
            dispatch(additemInitiate(input))
            setinput({code:'',domain: '',cpanel : '',username: '',password : '',owner: ''})
        }else{
            dispatch(updateitemInitiate(websiteid,input))
            setwebsiteid(null);
            seteditMode(false);
            setinput({code:'',domain: '',cpanel : '',username: '',password : '',owner: ''})
        }

    }
    const deletehandler = (id) =>{
        if(window.confirm('are you sure?')){
            dispatch(deleteitemInitiate(id))
        }
    }
    const edithandler = (id) =>{
        dispatch(edititemInitiate(id))
        seteditMode(true);
        setwebsiteid(id)
    }
    const copyhandler = (copieditemdata) =>{
        dispatch(copyitemInitiate(copieditemdata))
    }


    const deleteallhandler = (id) => {
        setradio([...radio,id])
    }
    const deleteall = (radio) =>{
        dispatch(deleteitemAllInitiate(radio))
    }

    useEffect(()=>{
        dispatch(getitemsInitiate())
    },[])

    useEffect(()=>{
        if(website){
            setinput({...website})
        }
    },[website])

    return(
        <>
        <tbody className="bg-white divide-y divide-gray-200">
                  {searchdata && searchdata.map((item) => (
                    <tr key={item.id}>
                      <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.code}
                    </td>
                    <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.domain}
                    </td>
                    <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.cpanel}
                    </td>
                    <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.username}
                    </td>
                    <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.password}
                    </td>
                    <td scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      {item.owner}
                    </td>

                      {/* <td className="px-6 py-3  whitespace-nowrap text-sm text-gray-500">{item.owner}</td> */}
                      <td className="px-6 py-3 whitespace-nowrap text-right text-sm font-medium">
                        <a href="#" className="text-indigo-600 mr-2 hover:text-indigo-900" onClick={()=>deletehandler(item.id)}>
                          Del
                        </a>
                        <a href="#" className="text-indigo-600 mr-2 hover:text-indigo-900" onClick={()=>copyhandler(item)}>
                          Copy
                        </a>
                        <a href="#" className="text-indigo-600 mr-2 hover:text-indigo-900" onClick={()=>edithandler(item.id)}>
                          Edit
                        </a>
                      </td>
                    </tr>
                  ))}
        </tbody>
        {/* <Form submitHandler={submitHandler} onchangehandler={onchangehandler} input={input}/> */}
        </>
    )
}
const Head = styled.div`
    display:flex;
    justify-content:space-between;
    color:white;
    margin-bottom:10px;
    div{
        text-align:center;
    }
`
// const mapStateprops = state =>{
//     return{
//         items:state.items
//     }

// }
// ---- same with inside currly brackets
// const mapDispatchToProps = (dispatch) =>{
//     return {
//         Fetchdata: (item) => dispatch(Fetchdata(item))
//     }
// }
export default connect()(TableBody)
